import React from "react";
import Book from "./Book";
import './BookList.css'

const books =[
    {
        title:"Inside of React",
        author: "김민주",
        coverImage: "data:image/png;base64,"
    },
    {
        title:"Book of Ice",
        author: "한유주",
        coverImage: "data:image/jpeg;base64,"
    },
    {
        title:"Dragon Raja",
        author: "이영도",
        coverImage: "data:image/jpeg;base64,"
    }
];


function BookList() {
    return(
        <div className={"bookListWrapper"}>
            {
                books.map((book) =>{
                    return(
                        <Book
                            title={book.title}
                            author={book.author}
                            coverImage={book.coverImage}
                        />
                    )
                })
            }
        </div>
    );
}

export default BookList;